export const isJSON = (str: any) => {
  if (typeof str == 'string') {
    try {
      var obj = JSON.parse(str)
      if (typeof obj == 'object' && obj) {
        return true
      } else {
        return false
      }
    } catch (e) {
      console.log('error:' + str + '!!!' + e)
      return false
    }
  }
}

/** 时间、数字范围内补齐 */
export const TimesDatas = (times: string[]) => {
  let oneHour = 60 * 60 * 24 * 1000

  let now = new Date(times[0])
  let max = new Date(times[times.length - 1])

  let result = []
  while (!(max < now)) {
    result.push(now)
    now = new Date(now.getTime() + oneHour)
  }
  return result.map((item) => moment(item).format('YYYY-MM-DD'))
}

export const unique = (arr: any[], val: string): any[] => {
  console.log('arr', arr)
  const res = new Map()
  return arr.filter((item) => !res.has(item[val]) && res.set(item[val], 1))
}

export function enUSNum(num: number) {
  return num.toLocaleString('en-US', { maximumFractionDigits: 6, style: 'decimal' })
}

